import NavBar from '../nav.js'
import './style.css'

function GetStartedButton(props) {
    return <a className ='btn btn-primary' 
        href="/sign_up" >
        Get Started...
    </a>
}

function GettingStartedView(props) {
    return <div 
        className="getting-started-container 
            hovered">

        <h1 className='fs-1 fw-bolder'>Personal Finance Manger</h1>
        <GetStartedButton/>

    </div>
}

function AboutAppView(props) {
    return <div className = 'landing-components hovered'
        style={{backgroundImage: 'url(../img/about_app_background.jpg)'}}>
        About App
    </div>
}

function OurTeamView(props) {
    return <div className = 'component-container hovered'>
        Our Team
    </div>
}

function ContactUsView(props) {
    return <div className = 'component-container hovered'>
        Contact Us
    </div>
}

export default function LandingPage(props) {
    return <div className = "container">

        <GettingStartedView/>
        <AboutAppView/>
        <OurTeamView/>
        <ContactUsView/>

    </div>
}



